--
-- Name: checks_stats; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.checks_stats AS
 SELECT count(*) AS total_checks,
    count(DISTINCT checks.card_last4) AS total_cards,
    count(DISTINCT checks.operator) AS total_operators,
    sum(
        CASE
            WHEN checks.is_p2p THEN 1
            ELSE 0
        END) AS p2p_count,
    sum(
        CASE
            WHEN checks.is_duplicate THEN 1
            ELSE 0
        END) AS duplicates_count,
    sum(
        CASE
            WHEN ((checks.source)::text = 'Telegram'::text) THEN 1
            ELSE 0
        END) AS telegram_count,
    sum(
        CASE
            WHEN ((checks.source)::text = 'SMS'::text) THEN 1
            ELSE 0
        END) AS sms_count,
    sum(
        CASE
            WHEN ((checks.source)::text = 'Manual'::text) THEN 1
            ELSE 0
        END) AS manual_count,
    min(checks.datetime) AS earliest_check,
    max(checks.datetime) AS latest_check,
    sum(checks.amount) AS total_amount
   FROM public.checks;


